import React from 'react';
import OrdersPage from './OrdersPage';

const Orders = ({ orders }) => {
  return (
    <div>
      <h1>My Orders</h1>
      {orders.length === 0 ? (
        <p>No orders placed yet.</p>
      ) : (
        <OrdersPage previousOrders={orders} />
      )}
    </div>
  );
};

export default Orders;
